import './App.css';
import {useEffect, useState} from 'react';


function Forms() {

  return (
    <div className="section">
       <form>
      <fieldset>
         <label>
           <p>Name</p>
           <input name="name" />
         </label>
       </fieldset>
       <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default Forms;
